product_description:
Mouvement à pile LR14;
Boitié en laiton façon or;
Cadran argenté avec chiffres romain;
Dim: 15.5x8.5cm
Année 1968 à 1976

Robe Hug an' co en lin (55%) rose fushia, entièrement boutonnée devant. 
Les doubles bretelles mettent en valeur les épaules, et le décolleté dos est joliment souligné par un laçage. 
 Ligne très près du corps, Largeur taille à plat 33,5 cm.Largeur hanches à plat 46 cm; Longueur totale 94 cm ;

Invitation au plaisir de la lecture...
Lot de 5 livres jeux comprenant L'école aux cent farces ; 
L'océan aux cent abîmes ; 
La fête aux maléfices ; 
Le jardin aux cent secrets ; 
La tour aux cent menaces. 

Chaque ouvrage est une aventure à vivre avec des défis à remporter à chaque page.

Oeuvres de francois coppée 1964-1972
Le Reliquaire, Poèmes divers, Intimité, Poèmes modernes;
La Grève des Forgerons, les Humbles écrit pendant le siège;
Plus de sang. Promenades et intérieurs;
paris, éditeur alphonse Lemerre, M.DCCC.LXXXIII (1883).
327 pages illustrées de 10 eaux-fortes hors-texte protégées par des serpentes (papier fin de protection contre les macules) par E. Boilvin
Intérieure en bon état ,couverture légèrement ouvert si non en bon état dans l'ensemble.
Œuvres signé par François coppée dédicacé a Eugène Pitou .
